import Avatar from '@material-ui/core/Avatar';

class IntroPage extends Component {
  render(){
    return (
      <div class = "Introduction">
        <Avatar src="profile_pic_resized.png" size={500}/>
      </div>
    );
  }
}

export default IntroPage;
